function Queue() {
	var B = new Array();
	var A = 50;
	Queue.prototype.EnQueue = function (C) {
		if (C == null) {
			return -1
		}
		if (B.length >= this.capacity) {
			B.remove(0)
		}
		B.push(C)
	};
	Queue.prototype.DeQueue = function () {
		if (B.length == 0) {
			return null
		} else {
			return B.shift()
		}
	};
	Queue.prototype.GetSize = function () {
		return B.length
	};
	Queue.prototype.GetHead = function () {
		if (B.length == 0) {
			return null
		} else {
			return B[0]
		}
	};
	Queue.prototype.MakeEmpty = function () {
		B.length = 0
	};
	Queue.prototype.IsEmpty = function () {
		if (B.length == 0) {
			return true
		} else {
			return false
		}
	}
}
var datas = new Array("", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "", "");
var canvas = null;
